import img1 from '../../assets/img/githubLogo.png';
import Project from '../Project';

export default function Portfolio() {
    const projects=[
        {
            image: img1,
            title: "Text Editor",
            description: "Text editor application utilizing indexedDB",
            deployedLink: "https://floating-island-67376.herokuapp.com/",
            githubLink: "https://github.com/cbazil114/text-editor",
        },
        {
            image: img1,
            title: "Social Network API",
            description: "Social network API created as a NoSQL database",
            deployedLink: "https://www.google.com",
            githubLink: "https://github.com/cbazil114/social-network-api",
        },
        {
            image: img1,
            title: "eCommerce Database",
            description: "Database created using MySQL, Sequelize, and .dotenv",
            deployedLink: "https://www.google.com",
            githubLink: "https://github.com/cbazil114/ecommerce",
        },
        {
            image: img1,
            title: "Test Title",
            description: "This is a test",
            deployedLink: "https://www.google.com",
            githubLink: "https://github.com/cbazil114/employee-database",
        },
    ]
    return(
        <div>
            {projects.map(app => {
                return <Project 
                title={app.title} 
                description={app.description} 
                deployedLink={app.deployedLink} 
                githubLink={app.githubLink} 
                />
            })}
        </div>
    )
}
